import Head from 'next/head';
import Pricing from 'container/Pricing/Pricing';

export default function pricingPage() {
  return (
    <>
      <Head>
        <title>Pricing plan | TripFinder.</title>
      </Head>
      <Pricing />
    </>
  );
}
